import React from "react";
// import "./style.css";
import Card from 'react-bootstrap/Card';
import { ListGroup } from "react-bootstrap";
import ListGroupItem from 'react-bootstrap/ListGroup';

function EmployeeProfiles() {
    return (
        <div>
    <Card style={{ width: '18rem' }}>
    <Card.Img variant="top" src="holder.js/100px180?text=Image cap" />
    <Card.Body>
        <Card.Title>Winston</Card.Title>
        <Card.Text>
        Some quick example text to build on the card title and make up the bulk of
        the card's content.
        </Card.Text>
    </Card.Body>
    <ListGroup className="list-group-flush">
        <ListGroupItem><b>Specialty:</b></ListGroupItem>
        <ListGroupItem>HVAC</ListGroupItem>
        <ListGroupItem>Interior Remodeling</ListGroupItem>
        <ListGroupItem>Exerior Remodeling</ListGroupItem>
    </ListGroup>
    <Card.Body>
        <Card.Link href="winston@fixit5.com">Email</Card.Link>
        <Card.Link href="#">Another Link</Card.Link>
    </Card.Body>
    </Card>
    </div>
    )
}

export default EmployeeProfiles;
